import React from 'react';
import Images from './common/Images';
import Area from './common/Area';
import Price from './common/Price';
import Address from './common/Address';

const Card = ({fullAddress, area, price, images, addTemplates}) => {
    // console.log(addTemplates);

    return (
        <div>
            {addTemplates.length !== 0 ?
            addTemplates[0].template.map(({component}) => 
                component === 'IMAGE' ? <Images images={images[0]}/>:
                component === 'ADDRESS' ? <Address fullAddress={fullAddress}/>:
                component === 'PRICE' ? <Price price={price}/>:
                component === 'AREA' ? <Area area={area}/>: null
            )
        : <span>loading</span>}
        </div>
    );
};

export default Card;
